module.exports = "<article><nz-affix class=\"toc-affix\" [nzOffsetTop]=\"16\">\n    <nz-anchor [nzAffix]=\"false\" nzShowInkInFixed (nzClick)=\"goLink($event)\">\n      <nz-link nzHref=\"#components-modal-demo-basic\" nzTitle=\"Basic\"></nz-link><nz-link nzHref=\"#components-modal-demo-async\" nzTitle=\"Asynchronously close\"></nz-link><nz-link nzHref=\"#components-modal-demo-footer\" nzTitle=\"Customized Footer\"></nz-link><nz-link nzHref=\"#components-modal-demo-confirm\" nzTitle=\"Confirmation modal dialog\"></nz-link><nz-link nzHref=\"#components-modal-demo-confirm-promise\" nzTitle=\"Confirmation modal dialog\"></nz-link><nz-link nzHref=\"#components-modal-demo-info\" nzTitle=\"Information modal dialog\"></nz-link><nz-link nzHref=\"#components-modal-demo-locale\" nzTitle=\"Internationalization\"></nz-link><nz-link nzHref=\"#components-modal-demo-manual\" nzTitle=\"Manual to destroy\"></nz-link><nz-link nzHref=\"#components-modal-demo-position\" nzTitle=\"To customize the position of modal\"></nz-link><nz-link nzHref=\"#components-modal-demo-service\" nzTitle=\"Modal's service\"></nz-link>\n    </nz-anchor>\n  </nz-affix><section class=\"markdown\">\n\t<h1>Modal<span class=\"subtitle\"></span>\n\t<a class=\"edit-button\" href=\"https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/modal/doc/index.en-US.md\" target=\"_blank\">\n\t\t<i nz-icon type=\"edit\"></i></a>\n</h1>\n\t<section class=\"markdown\" ngNonBindable>\n\t\t<p>Modal dialogs.</p>\n<h2 id=\"when-to-use\"><span>When To Use</span><a onclick=\"window.location.hash = 'when-to-use'\" class=\"anchor\">#</a></h2><p>When requiring users to interact with application, but without jumping to a new page to interrupt\nthe user&#39;s workflow, you can use <code>Modal</code> to create a new floating layer over the current page for user\ngetting feedback or information purposes.\nAdditionally, if you need show a simple confirmation dialog, you can use <code>NzModalService.confirm()</code>,\nand so on.</p>\n<p>It is recommended to use the <code>Component</code> way to pop up the Modal, so that the component logic of the popup layer can be completely isolated from the outer component, and can be reused at any time. In the popup layer component, you can obtain Modal&#39;s component instance by injecting <code>NzModalRef</code> to control the behavior of the modal box.</p>\n<h2 id=\"how-to-use\"><span>How To Use</span><a onclick=\"window.location.hash = 'how-to-use'\" class=\"anchor\">#</a></h2><p>If you want to modify the global default configuration, you can modify the value of provider <code>NZ_MODAL_CONFIG</code>.\n(eg, add <code>&#123; provide: NZ_MODAL_CONFIG, useValue: &#123; autoBodyPadding: false &#125;&#125;</code> to <code>providers</code> of your module, <code>NZ_MODAL_CONFIG</code> can be imported from <code>ng-zorro-antd</code>)</p>\n<p>The default global configuration is:</p>\n<pre><code class=\"lang-js\"><span class=\"token punctuation\">&#123;</span>\n  autoBodyPadding<span class=\"token punctuation\">:</span> <span class=\"token boolean\">true</span><span class=\"token punctuation\">,</span> <span class=\"token comment\" spellcheck=\"true\">// Whether to automatically add \"padding\" and \"overflow\" the body to hide the scroll bar</span>\n<span class=\"token punctuation\">&#125;</span>\n</code></pre>\n\n\t</section>\n\t\n\t<h2>\n\t\t<span>Examples</span>\n\t\t<i nz-icon type=\"appstore\" class=\"code-box-expand-trigger\" title=\"expand all code\" (click)=\"expandAllCode()\"></i>\n\t</h2>\n</section><div nz-row [nzGutter]=\"16\">\n\t<div nz-col [nzLg]=\"12\" [nzMd]=\"24\">\n\t\t<nz-code-box nzTitle=\"Basic\" [nzId]=\"'components-modal-demo-basic'\" nzSelector=\"nz-demo-modal-basic\" [nzLink]=\"'components-modal-demo-basic'\" nzGenerateCommand=\"ng g ng-zorro-antd:modal-basic -p app --name=\" nzComponentName=\"NzDemoModalBasicComponent\" [nzCode]=\"basic\" [nzRawCode]=\"basicRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/modal/demo/basic.md'\">\n\t<nz-demo-modal-basic demo></nz-demo-modal-basic>\n\t<div intro ngNonBindable>\n\t\t<p>Basic modal.</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"Customized Footer\" [nzId]=\"'components-modal-demo-footer'\" nzSelector=\"nz-demo-modal-footer\" [nzLink]=\"'components-modal-demo-footer'\" nzGenerateCommand=\"ng g ng-zorro-antd:modal-footer -p app --name=\" nzComponentName=\"NzDemoModalFooterComponent\" [nzCode]=\"footer\" [nzRawCode]=\"footerRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/modal/demo/footer.md'\">\n\t<nz-demo-modal-footer demo></nz-demo-modal-footer>\n\t<div intro ngNonBindable>\n\t\t<p>A more complex example which define a customized footer button bar,\nthe dialog will change to loading state after clicking submit button, when the loading is over,\nthe modal dialog will be closed.</p>\n<p>You could set <code>nzFooter</code> to <code>null</code> if you don&#39;t need default footer buttons.</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"Confirmation modal dialog\" [nzId]=\"'components-modal-demo-confirm-promise'\" nzSelector=\"nz-demo-modal-confirm-promise\" [nzLink]=\"'components-modal-demo-confirm-promise'\" nzGenerateCommand=\"ng g ng-zorro-antd:modal-confirm-promise -p app --name=\" nzComponentName=\"NzDemoModalConfirmPromiseComponent\" [nzCode]=\"confirmPromise\" [nzRawCode]=\"confirmPromiseRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/modal/demo/confirm-promise.md'\">\n\t<nz-demo-modal-confirm-promise demo></nz-demo-modal-confirm-promise>\n\t<div intro ngNonBindable>\n\t\t<p>To use <code>NzModalService.confirm()</code> to popup confirmation modal dialog. Let NzOnCancel/NzOnOk function return a promise object to\ndelay closing the dialog.</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"Internationalization\" [nzId]=\"'components-modal-demo-locale'\" nzSelector=\"nz-demo-modal-locale\" [nzLink]=\"'components-modal-demo-locale'\" nzGenerateCommand=\"ng g ng-zorro-antd:modal-locale -p app --name=\" nzComponentName=\"NzDemoModalLocaleComponent\" [nzCode]=\"locale\" [nzRawCode]=\"localeRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/modal/demo/locale.md'\">\n\t<nz-demo-modal-locale demo></nz-demo-modal-locale>\n\t<div intro ngNonBindable>\n\t\t<p>To customize the text of the buttons, you need to set <code>nzOkText</code> and <code>nzCancelText</code> props.</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"To customize the position of modal\" [nzId]=\"'components-modal-demo-position'\" nzSelector=\"nz-demo-modal-position\" [nzLink]=\"'components-modal-demo-position'\" nzGenerateCommand=\"ng g ng-zorro-antd:modal-position -p app --name=\" nzComponentName=\"NzDemoModalPositionComponent\" [nzCode]=\"position\" [nzRawCode]=\"positionRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/modal/demo/position.md'\">\n\t<nz-demo-modal-position demo></nz-demo-modal-position>\n\t<div intro ngNonBindable>\n\t\t<p>You can use <code>nzStyle.top</code> or other styles to set position of modal dialog.</p>\n<blockquote>\n<p><strong>NOTE</strong> Due to Angular&#39;s style isolation, you may need to override the NgZorro style with <code>:: ng-deep</code> within a custom style if <code>encapsulation: ViewEncapsulation.None</code> is not included in the Component</p>\n</blockquote>\n\n\t</div>\n</nz-code-box>\n\n\t</div>\n\t<div nz-col [nzLg]=\"12\" [nzMd]=\"24\">\n\t\t<nz-code-box nzTitle=\"Asynchronously close\" [nzId]=\"'components-modal-demo-async'\" nzSelector=\"nz-demo-modal-async\" [nzLink]=\"'components-modal-demo-async'\" nzGenerateCommand=\"ng g ng-zorro-antd:modal-async -p app --name=\" nzComponentName=\"NzDemoModalAsyncComponent\" [nzCode]=\"async\" [nzRawCode]=\"asyncRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/modal/demo/async.md'\">\n\t<nz-demo-modal-async demo></nz-demo-modal-async>\n\t<div intro ngNonBindable>\n\t\t<p>Asynchronously close a modal dialog when a user clicked OK button, for example,\nyou can use this pattern when you submit a form.</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"Confirmation modal dialog\" [nzId]=\"'components-modal-demo-confirm'\" nzSelector=\"nz-demo-modal-confirm\" [nzLink]=\"'components-modal-demo-confirm'\" nzGenerateCommand=\"ng g ng-zorro-antd:modal-confirm -p app --name=\" nzComponentName=\"NzDemoModalConfirmComponent\" [nzCode]=\"confirm\" [nzRawCode]=\"confirmRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/modal/demo/confirm.md'\">\n\t<nz-demo-modal-confirm demo></nz-demo-modal-confirm>\n\t<div intro ngNonBindable>\n\t\t<p>To use <code>NzModalService.confirm()</code> to popup a confirmation modal dialog.</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"Information modal dialog\" [nzId]=\"'components-modal-demo-info'\" nzSelector=\"nz-demo-modal-info\" [nzLink]=\"'components-modal-demo-info'\" nzGenerateCommand=\"ng g ng-zorro-antd:modal-info -p app --name=\" nzComponentName=\"NzDemoModalInfoComponent\" [nzCode]=\"info\" [nzRawCode]=\"infoRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/modal/demo/info.md'\">\n\t<nz-demo-modal-info demo></nz-demo-modal-info>\n\t<div intro ngNonBindable>\n\t\t<p>In the various types of information modal dialog, only one button to close dialog is provided.</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"Manual to destroy\" [nzId]=\"'components-modal-demo-manual'\" nzSelector=\"nz-demo-modal-manual\" [nzLink]=\"'components-modal-demo-manual'\" nzGenerateCommand=\"ng g ng-zorro-antd:modal-manual -p app --name=\" nzComponentName=\"NzDemoModalManualComponent\" [nzCode]=\"manual\" [nzRawCode]=\"manualRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/modal/demo/manual.md'\">\n\t<nz-demo-modal-manual demo></nz-demo-modal-manual>\n\t<div intro ngNonBindable>\n\t\t<p>Manually destroying a modal.</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"Modal's service\" [nzId]=\"'components-modal-demo-service'\" nzSelector=\"nz-demo-modal-service\" [nzLink]=\"'components-modal-demo-service'\" nzGenerateCommand=\"ng g ng-zorro-antd:modal-service -p app --name=\" nzComponentName=\"NzDemoModalServiceComponent\" [nzCode]=\"service\" [nzRawCode]=\"serviceRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/modal/demo/service.md'\">\n\t<nz-demo-modal-service demo></nz-demo-modal-service>\n\t<div intro ngNonBindable>\n\t\t<p>Usage of Modal&#39;s service, examples demonstrate user-defined templates, custom components, and methods for injecting modal instances.</p>\n<blockquote>\n<p><strong>NOTE</strong> If you use Component mode, you need to add your custom Component into <code>declarations</code> and <code>entryComponents</code> for a <code>NgModule</code></p>\n</blockquote>\n\n\t</div>\n</nz-code-box>\n\n\t</div>\n</div>\n<section class=\"markdown api-container\" ngNonBindable><h2 id=\"api\"><span>API</span><a onclick=\"window.location.hash = 'api'\" class=\"anchor\">#</a></h2><h3 id=\"nzmodalservice\"><span>NzModalService</span><label class=\"api-type-label service\">service</label><a onclick=\"window.location.hash = 'nzmodalservice'\" class=\"anchor\">#</a></h3><p>The dialog is currently divided into 2 modes, <code>normal mode</code> and <code>confirm box mode</code> (ie the <code>Confirm</code> dialog, which is called by calling <code>confirm/info/success/error/warning</code>). The degree of API support for the two modes is slightly different.</p>\n<table>\n<thead>\n<tr>\n<th>Property</th>\n<th>Description</th>\n<th>Type</th>\n<th>Default</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>nzAfterOpen</td>\n<td>Specify a EventEmitter that will be emitted when modal opened</td>\n<td>EventEmitter</td>\n<td>-</td>\n</tr>\n<tr>\n<td>nzAfterClose</td>\n<td>Specify a EventEmitter that will be emitted when modal is closed completely (Can listen for parameters passed in the close/destroy method)</td>\n<td>EventEmitter</td>\n<td>-</td>\n</tr>\n<tr>\n<td>nzBodyStyle</td>\n<td>Body style for modal body element. Such as height, padding etc.</td>\n<td>object</td>\n<td>-</td>\n</tr>\n<tr>\n<td>nzCancelText</td>\n<td>Text of the Cancel button. <i>Set to null to show no cancel button (this value is invalid if the nzFooter parameter is used in normal mode)</i></td>\n<td>string</td>\n<td>Cancel</td>\n</tr>\n<tr>\n<td>nzClosable</td>\n<td>Whether a close (x) button is visible on top right of the modal dialog or not. <i>Invalid value in confirm box mode (default will be hidden)</i></td>\n<td>boolean</td>\n<td>true</td>\n</tr>\n<tr>\n<td>nzOkLoading</td>\n<td>Whether to apply loading visual effect for OK button or not</td>\n<td>boolean</td>\n<td>false</td>\n</tr>\n<tr>\n<td>nzCancelLoading</td>\n<td>Whether to apply loading visual effect for Cancel button or not</td>\n<td>boolean</td>\n<td>false</td>\n</tr>\n<tr>\n<td>nzFooter</td>\n<td>Footer content, set as footer=null when you don&#39;t need default buttons. <i>1. Only valid in normal mode.<br>2. You can customize the buttons to the maximum extent by passing a <code>ModalButtonOptions</code> configuration (see the case or the instructions below).</i></td>\n<td>string<br>TemplateRef<br>ModalButtonOptions</td>\n<td>OK and Cancel buttons</td>\n</tr>\n<tr>\n<td>nzGetContainer</td>\n<td>The mount node for Modal</td>\n<td>HTMLElement / () =&gt; HTMLElement</td>\n<td>A default container</td>\n</tr>\n<tr>\n<td>nzMask</td>\n<td>Whether show mask or not.</td>\n<td>boolean</td>\n<td>true</td>\n</tr>\n<tr>\n<td>nzMaskClosable</td>\n<td>Whether to close the modal dialog when the mask (area outside the modal) is clicked</td>\n<td>boolean</td>\n<td>true</td>\n</tr>\n<tr>\n<td>nzMaskStyle</td>\n<td>Style for modal&#39;s mask element.</td>\n<td>object</td>\n<td>-</td>\n</tr>\n<tr>\n<td>nzOkText</td>\n<td>Text of the OK button. <i>Set to null to show no cancel button (this value is invalid if the nzFooter parameter is used in normal mode)</i></td>\n<td>string</td>\n<td>OK</td>\n</tr>\n<tr>\n<td>nzOkType</td>\n<td>Button type of the OK button. <i>Consistent with the type of the <code>nz-button</code>.</i></td>\n<td>string</td>\n<td>primary</td>\n</tr>\n<tr>\n<td>nzStyle</td>\n<td>Style of floating layer, typically used at least for adjusting the position.</td>\n<td>object</td>\n<td>-</td>\n</tr>\n<tr>\n<td>nzTitle</td>\n<td>The modal dialog&#39;s title. <i>Leave blank to show no title. The usage of TemplateRef can refer to the case</i></td>\n<td>string / TemplateRef</td>\n<td>-</td>\n</tr>\n<tr>\n<td>nzVisible</td>\n<td>Whether the modal dialog is visible or not. <i>When using the <code>&lt;nz-modal&gt;</code> tag, be sure to use two-way binding, for example: <code>[(nzVisible)]=&quot;visible&quot;</code>.</i></td>\n<td>boolean</td>\n<td>false</td>\n</tr>\n<tr>\n<td>nzWidth</td>\n<td>Width of the modal dialog. <i>When using numbers, the default unit is <code>px</code></i></td>\n<td>string<br>number</td>\n<td>520</td>\n</tr>\n<tr>\n<td>nzClassName</td>\n<td>The class name of the modal dialog</td>\n<td>string</td>\n<td>-</td>\n</tr>\n<tr>\n<td>nzWrapClassName</td>\n<td>The class name of the container of the modal dialog</td>\n<td>string</td>\n<td>-</td>\n</tr>\n<tr>\n<td>nzZIndex</td>\n<td>The z-index of the Modal</td>\n<td>number</td>\n<td>1000</td>\n</tr>\n<tr>\n<td>nzOnCancel</td>\n<td>Specify a function that will be called when a user clicks mask, close button on top right or Cancel button (If nzContent is Component, the Component instance will be put in as an argument). <i>Note: When created with <code>NzModalService.create</code>, this parameter should be passed into the type of function (callback function). This function returns a promise, which is automatically closed when the execution is complete or the promise ends (return <code>false</code> to prevent closing)</i></td>\n<td>EventEmitter</td>\n<td>-</td>\n</tr>\n<tr>\n<td>nzOnOk</td>\n<td>Specify a EventEmitter that will be emitted when a user clicks the OK button (If nzContent is Component, the Component instance will be put in as an argument). <i>Note: When created with <code>NzModalService.create</code>, this parameter should be passed into the type of function (callback function). This function returns a promise, which is automatically closed when the execution is complete or the promise ends (return <code>false</code> to prevent closing)</i></td>\n<td>EventEmitter</td>\n<td>无</td>\n</tr>\n<tr>\n<td>nzContent</td>\n<td>Content</td>\n<td>string / TemplateRef / Component / ng-content</td>\n<td>-</td>\n</tr>\n<tr>\n<td>nzComponentParams</td>\n<td>When nzContent is a Component, the attributes in this parameter will be passed to the nzContent instance</td>\n<td>object</td>\n<td>-</td>\n</tr>\n<tr>\n<td>nzIconType</td>\n<td>Icon type of the Icon component. <i>Only valid in confirm box mode</i></td>\n<td>string</td>\n<td>question-circle</td>\n</tr>\n</tbody>\n</table>\n<h4 id=\"attentions\"><span>Attentions</span><a onclick=\"window.location.hash = 'attentions'\" class=\"anchor\">#</a></h4><blockquote>\n<p>The default state of <code>&lt;nz-modal&gt;</code> will not be automatically cleared. If you wish to open new content each time, use the <code>NzModalService</code> service to create modals (when created as a service, the <code>nzAfterClose</code> event will be listened by default aim to destroy the modal).</p>\n<p>Modals created through the <code>NzModalService</code> service need you to manage their own life cycle. For example, when you switch the page route, the modal box created by service will not be destroyed automatically. You need to use the modal box&#39;s reference to manually destroy it (<code>NzModalRef.close()</code> or <code>NzModalRef.destroy()</code>).</p>\n</blockquote>\n<h4 id=\"using-service-to-create-normal-mode-modal\"><span>Using service to create Normal Mode modal</span><a onclick=\"window.location.hash = 'using-service-to-create-normal-mode-modal'\" class=\"anchor\">#</a></h4><blockquote>\n<p>You can call <code>NzModalService.create(options)</code> to dynamically create <strong>normal mode</strong> modals, where <code>options</code> is an object that supports the support given in the API above <strong>normal mode</strong> parameters</p>\n</blockquote>\n<h3 id=\"confirm-box-mode---nzmodalservice-method()\"><span>Confirm box mode - NzModalService.method()</span><a onclick=\"window.location.hash = 'confirm-box-mode---nzmodalservice-method()'\" class=\"anchor\">#</a></h3><p>There are five ways to display the information based on the content&#39;s nature:</p>\n<ul>\n<li><code>NzModalService.info</code></li>\n<li><code>NzModalService.success</code></li>\n<li><code>NzModalService.error</code></li>\n<li><code>NzModalService.warning</code></li>\n<li><code>NzModalService.confirm</code></li>\n</ul>\n<p>The items listed above are all functions, expecting a settings object as parameter.\nConsistent with the above API, some property types or initial values are different as follows:</p>\n<table>\n<thead>\n<tr>\n<th>Property</th>\n<th>Description</th>\n<th>Type</th>\n<th>Default</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>nzOnOk</td>\n<td>Specify a EventEmitter that will be emitted when a user clicks the OK button (If nzContent is Component, the Component instance will be put in as an argument.). <i>This function returns a promise, which is automatically closed when the execution is complete or the promise ends (return <code>false</code> to prevent closing)</i></td>\n<td>function</td>\n<td>-</td>\n</tr>\n<tr>\n<td>nzOnCancel</td>\n<td>Specify a function that will be called when a user clicks mask, close button on top right or Cancel button (If nzContent is Component, the Component instance will be put in as an argument.). <i>This function returns a promise, which is automatically closed when the execution is complete or the promise ends (return <code>false</code> to prevent closing)</i></td>\n<td>function</td>\n<td>-</td>\n</tr>\n<tr>\n<td>nzWidth</td>\n<td>Width of the modal dialog</td>\n<td>string / number</td>\n<td>416</td>\n</tr>\n<tr>\n<td>nzMaskClosable</td>\n<td>Whether to close the modal dialog when the mask (area outside the modal) is clicked</td>\n<td>boolean</td>\n<td>false</td>\n</tr>\n</tbody>\n</table>\n<p>All the <code>NzModalService.method</code>s will return a reference, and then we can close the popup by the reference.</p>\n<pre><code class=\"lang-ts\"><span class=\"token keyword\">constructor</span><span class=\"token punctuation\">(</span>modal<span class=\"token punctuation\">:</span> NzModalService<span class=\"token punctuation\">)</span> <span class=\"token punctuation\">&#123;</span>\n  <span class=\"token keyword\">const</span> ref<span class=\"token punctuation\">:</span> NzModalRef <span class=\"token operator\">=</span> modal<span class=\"token punctuation\">.</span><span class=\"token function\">info</span><span class=\"token punctuation\">(</span><span class=\"token punctuation\">)</span><span class=\"token punctuation\">;</span>\n  ref<span class=\"token punctuation\">.</span><span class=\"token function\">close</span><span class=\"token punctuation\">(</span><span class=\"token punctuation\">)</span><span class=\"token punctuation\">;</span> <span class=\"token comment\" spellcheck=\"true\">// Or ref.destroy(); This dialog will be destroyed directly</span>\n<span class=\"token punctuation\">&#125;</span>\n</code></pre>\n<h3 id=\"related-type-definition\"><span>Related type definition</span><a onclick=\"window.location.hash = 'related-type-definition'\" class=\"anchor\">#</a></h3><h4 id=\"other-methods/attributes-for-nzmodalservice\"><span>Other Methods/Attributes for NzModalService</span><a onclick=\"window.location.hash = 'other-methods/attributes-for-nzmodalservice'\" class=\"anchor\">#</a></h4><table>\n<thead>\n<tr>\n<th>Methods/Attributes</th>\n<th>Description</th>\n<th>Type</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>openModals</td>\n<td>All currently open Modal list</td>\n<td>NzModalRef[]</td>\n</tr>\n<tr>\n<td>afterAllClose</td>\n<td>Callback called after all Modals closed completely</td>\n<td>Observable&lt;void&gt;</td>\n</tr>\n<tr>\n<td>closeAll()</td>\n<td>Close all modals</td>\n<td>function</td>\n</tr>\n</tbody>\n</table>\n<h4 id=\"nzmodalref\"><span>NzModalRef</span><a onclick=\"window.location.hash = 'nzmodalref'\" class=\"anchor\">#</a></h4><blockquote>\n<p>NzModalRef object is used to control dialogs and communicate with inside content</p>\n</blockquote>\n<p>The dialog created by the service method <code>NzModalService.xxx()</code> will return a <code>NzModalRef</code> object that is used to manipulate the dialog (this object can also be obtained by dependency injection <code>NzModalRef</code> if <code>nzContent</code> is used as Component) , This object has the following methods:</p>\n<table>\n<thead>\n<tr>\n<th>Method</th>\n<th>Description</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>afterOpen</td>\n<td>Same as nzAfterOpen but of type Observable&lt;void&gt;</td>\n</tr>\n<tr>\n<td>afterClose</td>\n<td>Same as nzAfterClose, but of type Observable&lt;result:any&gt;</td>\n</tr>\n<tr>\n<td>open()</td>\n<td>Open (display) dialog box. <i>Calling this function will fail if the dialog is already destroyed</i></td>\n</tr>\n<tr>\n<td>close()</td>\n<td>Close (hide) the dialog. <i>Note: When used for a dialog created as a service, this method will destroy the dialog directly (as with the destroy method)</i></td>\n</tr>\n<tr>\n<td>destroy()</td>\n<td>Destroy the dialog. <i>Note: Used only for dialogs created by the service (non-service created dialogs, this method only hides the dialog)</i></td>\n</tr>\n<tr>\n<td>getContentComponent()</td>\n<td>Gets the Component instance in the contents of the dialog for <code>nzContent</code>. <i> Note: When the dialog is not initialized (<code>ngOnInit</code> is not executed), this function will return <code>undefined</code></i></td>\n</tr>\n<tr>\n<td>triggerOk()</td>\n<td>Manually trigger nzOnOk</td>\n</tr>\n<tr>\n<td>triggerCancel()</td>\n<td>Manually trigger nzOnCancel</td>\n</tr>\n</tbody>\n</table>\n<h4 id=\"modalbuttonoptions-(used-to-customize-the-bottom-button)\"><span>ModalButtonOptions (used to customize the bottom button)</span><a onclick=\"window.location.hash = 'modalbuttonoptions-(used-to-customize-the-bottom-button)'\" class=\"anchor\">#</a></h4><p>An array of <code>ModalButtonOptions</code> type can be passed to <code>nzFooter</code> for custom bottom buttons.</p>\n<p>The button configuration items are as follows (along with the button component):</p>\n<pre><code class=\"lang-ts\">nzFooter<span class=\"token punctuation\">:</span> <span class=\"token punctuation\">[</span><span class=\"token punctuation\">&#123;</span>\n  label<span class=\"token punctuation\">:</span> <span class=\"token keyword\">string</span><span class=\"token punctuation\">;</span> <span class=\"token comment\" spellcheck=\"true\">// Button text</span>\n  type<span class=\"token operator\">?</span><span class=\"token punctuation\">:</span> <span class=\"token keyword\">string</span><span class=\"token punctuation\">;</span> <span class=\"token comment\" spellcheck=\"true\">// Types</span>\n  shape<span class=\"token operator\">?</span><span class=\"token punctuation\">:</span> <span class=\"token keyword\">string</span><span class=\"token punctuation\">;</span> <span class=\"token comment\" spellcheck=\"true\">// Shape</span>\n  ghost<span class=\"token operator\">?</span><span class=\"token punctuation\">:</span> <span class=\"token keyword\">boolean</span><span class=\"token punctuation\">;</span> <span class=\"token comment\" spellcheck=\"true\">// Whether ghost</span>\n  size<span class=\"token operator\">?</span><span class=\"token punctuation\">:</span> <span class=\"token keyword\">string</span><span class=\"token punctuation\">;</span> <span class=\"token comment\" spellcheck=\"true\">// Size</span>\n  autoLoading<span class=\"token operator\">?</span><span class=\"token punctuation\">:</span> <span class=\"token keyword\">boolean</span><span class=\"token punctuation\">;</span> <span class=\"token comment\" spellcheck=\"true\">// The default is true. If true, this button will automatically be set to the loading state when onClick returns a promise.</span>\n\n  <span class=\"token comment\" spellcheck=\"true\">// Tip: The `this` of below methods points to the configuration object itself. When nzContent is a component class, the contentComponentInstance parameter passed in by the method below is an instance of the component class</span>\n  <span class=\"token comment\" spellcheck=\"true\">// Whether to show this button</span>\n  show<span class=\"token operator\">?</span><span class=\"token punctuation\">:</span> <span class=\"token keyword\">boolean</span> <span class=\"token operator\">|</span> <span class=\"token punctuation\">(</span><span class=\"token punctuation\">(</span><span class=\"token keyword\">this</span><span class=\"token punctuation\">:</span> ModalButtonOptions<span class=\"token punctuation\">,</span> contentComponentInstance<span class=\"token operator\">?</span><span class=\"token punctuation\">:</span> object<span class=\"token punctuation\">)</span> <span class=\"token operator\">=</span><span class=\"token operator\">></span> <span class=\"token keyword\">boolean</span><span class=\"token punctuation\">)</span><span class=\"token punctuation\">;</span>\n  <span class=\"token comment\" spellcheck=\"true\">// Whether to display loading</span>\n  loading<span class=\"token operator\">?</span><span class=\"token punctuation\">:</span> <span class=\"token keyword\">boolean</span> <span class=\"token operator\">|</span> <span class=\"token punctuation\">(</span><span class=\"token punctuation\">(</span><span class=\"token keyword\">this</span><span class=\"token punctuation\">:</span> ModalButtonOptions<span class=\"token punctuation\">,</span> contentComponentInstance<span class=\"token operator\">?</span><span class=\"token punctuation\">:</span> object<span class=\"token punctuation\">)</span> <span class=\"token operator\">=</span><span class=\"token operator\">></span> <span class=\"token keyword\">boolean</span><span class=\"token punctuation\">)</span><span class=\"token punctuation\">;</span>\n  <span class=\"token comment\" spellcheck=\"true\">// Is it disabled</span>\n  disabled<span class=\"token operator\">?</span><span class=\"token punctuation\">:</span> <span class=\"token keyword\">boolean</span> <span class=\"token operator\">|</span> <span class=\"token punctuation\">(</span><span class=\"token punctuation\">(</span><span class=\"token keyword\">this</span><span class=\"token punctuation\">:</span> ModalButtonOptions<span class=\"token punctuation\">,</span> contentComponentInstance<span class=\"token operator\">?</span><span class=\"token punctuation\">:</span> object<span class=\"token punctuation\">)</span> <span class=\"token operator\">=</span><span class=\"token operator\">></span> <span class=\"token keyword\">boolean</span><span class=\"token punctuation\">)</span><span class=\"token punctuation\">;</span>\n  <span class=\"token comment\" spellcheck=\"true\">// Callback of clicking</span>\n  onClick<span class=\"token operator\">?</span><span class=\"token punctuation\">(</span><span class=\"token keyword\">this</span><span class=\"token punctuation\">:</span> ModalButtonOptions<span class=\"token punctuation\">,</span> contentComponentInstance<span class=\"token operator\">?</span><span class=\"token punctuation\">:</span> object<span class=\"token punctuation\">)</span><span class=\"token punctuation\">:</span> <span class=\"token keyword\">void</span> <span class=\"token operator\">|</span> Promise<span class=\"token operator\">&amp;</span>lt<span class=\"token punctuation\">;</span><span class=\"token keyword\">void</span><span class=\"token operator\">&amp;</span>gt<span class=\"token punctuation\">;</span> <span class=\"token operator\">|</span> <span class=\"token keyword\">any</span><span class=\"token punctuation\">;</span>\n<span class=\"token punctuation\">&#125;</span><span class=\"token punctuation\">]</span>\n</code></pre>\n<p>The above configuration items can also be changed in real-time to trigger the button behavior change.</p>\n</section></article>"

